import React, { Component } from 'react';
import {Navbar,Nav} from 'react-bootstrap'

export class Navigation extends Component {
  render() {
    return (
      <Navbar bg="dark" variant="dark ps-5 pe-5 ">
        <Navbar.Brand href="#home">Navbar</Navbar.Brand>
        <Nav className="d-flex justfity-content-left">
          <Nav.Link to="/" href="#home">Home</Nav.Link>
          <Nav.Link to="/Department" href="#features">Department</Nav.Link>
          <Nav.Link to="/Employee" href="#pricing">Employee</Nav.Link>
        </Nav>
    </Navbar>
    )
  }
}
